        {
            massage: 'post3',
            like: 1
        },
    ]
    let arr_post = postInfo.map((el) =>  <MyPost massage={el.massage} like={el.like}/>)
    return <div>
        <div>
            <h3> My post</h3>
            <textarea></textarea>
            <button>add button</button>
            <button>remove button</button>
        </div>
       <div>
           {arr_post}
